import React from "react";

const Weather = () => {
  return (
    <div className="container">
      <div className="cards">
      <h1 className="itemsTitle">Météo</h1>
      <span className="meteoTemperature">5°C</span> {/* py-2 */}
      {minmaxTemp()}
      </div>
    </div>
  )
}

function minmaxTemp(min,max) {
  return(
    <><span className="minTemp">{min}°C</span><span className="maxTemp">{max}°C</span></>
  );
}

export default Weather;

